import React from 'react';
import '../styles/Home.css';

function Home() {
  return (
    <div className="home">
      <h1>Dobrodošli na Travel Bosna!</h1>
      <p>Istražite najljepše destinacije širom svijeta.</p>
    </div>
  );
}

export default Home;
